import React from 'react';
import Card from './Card';
import './Card.css';

const Materia = ["Português", "Matemática"];


function App() {
  return (
    <div style={{ padding: '20px' }}>
      Materia.forEach(aplicarMateria){
        <Card title="Materia 1" content="Conteúdo da materia 1" />
      })
    </div>
  );
}

export default App;
